zh:
{'name': '台灣當代文化實驗場(C-LAB)', 'bio': '空總臺灣當代文化實驗場（C-LAB）以「創新」為核心理念與行動指標，形塑台灣最重要的當代文化培養皿。旨在打造一個面向未來的創新實驗平台：對外推動台灣與國際的對話鏈結，激發從台灣和亞洲生活經驗出發的當代文化想像；對內作為創意育成的實體基地，期待能讓不同創意在此互動激盪，營造開放包容的文化生態和社會環境。

C-LAB的執行方向是以「建構平台―媒合創新」為起點，立基於前瞻視野、具有開放包容機制，以及能夠激發、吸納不同創意和觀念，媒合育成各種創新事物的文化生態體系，並較傳統藝文場館更具創新動能，以創造出跨域多元的文化視野。因此，文化實驗場將開放文化專業人士與科技支援團隊進駐提案，推動跨領域與跨學科的協作與共創，藉此催化當代藝術界和不同學科知識領域，乃至於社會實踐團體的互融與交流。

C-LAB本年度重點發展計畫之一為建立科技媒體實驗平臺（Technology Media Platform)，持續推動實驗創新與社會鏈結，將陸續成立各類型科技媒體實驗室，與海內外相關專業領域的機構、團體與創作者，關注社會脈動與產業趨勢，透過跨域、共創、協作的方式，聯合推動文化與科技的實驗計畫，以期為本土科技媒體實驗創新拋磚引玉。'}

{'name': '趙柏強 (Po-chiang Chao, BobChao)', 'bio': 'Bob Chao (趙柏強) is one of the core-contributors of COSCUP and a board member of the [Open Culture Foundation](https://ocf.tw). He joined the FLOSS movement since his college life, contributed to Mozilla projects, Creative Commons, Wikipedia, and many more in different ways.

Besides the volunteer works, Bob is the Product Manager of KKTIX, a ticketing platform from the KKBOX Group.

Check his profile page on [Mozilla Reps](https://reps.mozilla.org/u/bobchao/) or [LinkedIn](https://www.linkedin.com/in/bobchao/).'}

en:
{'name': '趙柏強 (Po-chiang Chao, BobChao)', 'bio': 'Po-chiang Chao (aka. BobChao) started his Mozillian life as a volunteer since 2002 and then co-founded the [community web site](https://moztw.org) in 2004. He is mainly focused on contributor engagement, helping others achieve their goals on Mozilla projects.

Besides Mozilla, Bob was a translator of some technical books, the Development Manager of Creative Commons Taiwan, and then an User Experience Designer in ISOBAR. Also, he is a board member of the Open Culture Foundation and was the chief-organizer of the Conference for Open Source Coders, Users, and Promoters (COSCUP,) which is the largest FLOSS conference in Taiwan, during 2012-2014, and still serve as a core-contributor of the event.

Bob now works for KKBOX in a department that focuses on online ticket-selling service with a few products released under GPL, and active in many FLOSS events.'}

zh:
{'name': 'Eriol Fox', 'bio': 'Eriol is a Design Lead who has worked in-house for 9+ years. Eriol is Design lead at Third Sector Design (https://thirdsectordesign.org/), runs Humanitarian.design human rights-focused and humanitarian design project and is part of the core team at Open Source Design. Before that, they worked at Ushahidi, a non-profit developing open-source, digital tools to help people with democratic processes, human rights, and crises like typhoons, earthquakes and terrorism.

Eriol is a non-binary, queer person who uses they/them pronouns and an LGBTQIA+ advocate.
They are deeply passionate about intersectional inclusion and promoting healthy attitudes towards mental health in the tech sector.'}

