zh:
{'name': '馮彥文', 'bio': 'Strike Protocol 共同創辦人。

Strike Protocol 是一個 DeFi 的去中心化衍生性金融商品協議，使用自動做市的智能合約直接提供流動性給衍生性金融商品交易員。

馮彥文於 2000 - 2003 曾在美國矽谷的行動軟體公司及創投服務。2004 年開始創業，曾創辦 Cubie，Gamelet，Willmobile 等不同型態的 B2C 網路服務公司。其中 Cubie 在全世界有超過千萬下載，Willmobile 提供行動股市交易服務，後來與精誠合併為精誠隨想。2017 年開始投入區塊鏈，共同創辦的 Decore，是提供區塊鏈上的會計服務系統給區塊鏈公司。'}

